const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  );
}

const Part = (props) => {
  return (
    <div>
      <p>{props[0].name} {props[0].excercises}</p>
      <p>{props[1].name} {props[1].excercises}</p>
      <p>{props[2].name} {props[2].excercises}</p>
    </div>
  );
}

const Content = (props) => {
  return (
    <div>
      <Part part = {props.part1} excercise = {props.exercise1}></Part>
      <Part part = {props.part2} excercise = {props.exercise2}></Part>
      <Part part = {props.part3} excercise = {props.exercise3}></Part>
    </div>
  );
}
const Total = (props) => {
  return (
    <p>Number of exercises {props.total}</p>
  );
}

const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return (
    <div>
      <Header course={course}></Header>
      <Content parts={parts}></Content>
      <Total parts={parts}></Total>
    </div>
  )
}

export default App
